Picking up two years after the hit miniseries &quot;Lonesome Dove&quot; left off, this spin-off follows Newt Call (Scott Bairstow) after the tragic death of his wife. Back in town, Newt tries to settle into a normal life amid some equally trobled folks, including his brother-in-law, Austin (Paul Johansson), town bully Clayton (Eric McCormack), mysterious hotel owner Amanda (Ttacy Scoggins) and enigmatic newcomer Mattie (Kelly Rowan). 

